import React from "react";

//libraries.
import { Link } from "react-router-dom";

//Local stuff.
import "../styles/main.scss";
import HeadShot from "../assets/head_shot.png";

function Home() {
  return (
    <div className="center">
      <div className="main-width">
        <div className="navigation">
          <Link className="link" to="/">
            <p className="link-about black-text light-font">About</p>
          </Link>
          <Link className="link" to="/">
            <p className="link-portfolio black-text light-font">Portfolio</p>
          </Link>
        </div>

        <div className="flex-content-a">
          <h1 className="header-text black-text heavy-font">
            Hi, I'm<br></br>Alexander<br></br>Stewart
            <span style={{ color: "#FF9D9D" }}>.</span>
          </h1>

          <div className="head-shot-container">
            <img
              className="head-shot"
              src={HeadShot}
              alt="Alexander Stewart head shot"
            />
          </div>
        </div>

        <p className="blurb black-text light-font">
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Cum suscipit
          consequatur neque necessitatibus dignissimos aliquid, quisquam ducimus
          nobis unde adipisci ipsum. Autem facilis repudiandae maxime animi ut
          quam perferendis iure pariatur aliquid. Exercitationem dolores
          suscipit atque non delectus in praesentium?
        </p>
      </div>
    </div>
  );
}

export default Home;
